import React from "react";
import Input from "../../UI/Input";
import classes from "./MealItemForm.module.css";

const MealItemForm = () => {
   return (
      <form className={classes.form}>
         <input />
         <Input
            label="Amount"
            input={{
               id: "amount",
               type: "number",
               min: "1",
               max: "5",
            }}
         />
         <button>+ Add</button>
      </form>
   );
};

export default MealItemForm;
